import {Form, Modal, Input, Select } from "antd";

export const CreateBill = ({ isModalOpen, setIsModalOpen }) => {
  return (
    <Modal
      title="Fatura Oluştur"
      open={isModalOpen}
      footer={false}
      onCancel={() => setIsModalOpen(false)}
    >
        <Form layout="vertical">
            <Form.Item label="Müşterinin Adı" rules={[{required:true}]}>
                <Input placeholder="Müşterinin Adı"/>
            </Form.Item>
            <Form.Item label="Müşterinin Adı" rules={[{required:true}]}>
                <Input placeholder="Müşterinin Adı"/>
            </Form.Item>
            <Form.Item label="Ödeme Yöntemi" rules={[{required:true}]}>
                <Select defaultActiveFirstOption="Seçiniz">
                    <Select.Option value="Nakit">Nakit</Select.Option>
                    <Select.Option value="Kredi Kartı">Kredi Kartı</Select.Option>
                    </Select>
            </Form.Item>
        </Form>
    </Modal>
  );
};
